import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { Container } from "react-bootstrap";
import "./App.css";

import { NavbarComponent, Footer } from "./components";

const App = () => {
  return (
    <Router>
      <Container className="p-0" fluid={true}>
        <NavbarComponent />
        <Footer />
      </Container>
    </Router>
  );
};

export default App;
